import React from 'react'
import ListItem from './ListItem'
import '../css/ListContainer.css'

class ListContainer extends React.Component {
    render() {
        return (
            <div id="list-container">
             < ListItem todoText='Roshan'/>
            </div>
        );
    }
}

export default ListContainer;
